create table cp_trigger_data
(
    id              varchar(64)  not null comment '主键ID'
        primary key,
    trigger_id      varchar(64)  null comment '触发器主键ID',
    device_id       varchar(64)  null comment '设备主键ID',
    sensor_id       varchar(64)  null comment '传感器主键ID',
    sensor_name     varchar(64)  null comment '传感器名称',
    smg_status      int(1)       null comment '消息发送状态 0 正常 1失败',
    msg_send_result varchar(500) null comment '消息发送结果',
    trigger_content varchar(255) null comment '触发内容',
    trgger_date     datetime     null comment '触发时间',
    trigger_val     varchar(255) null comment '触发值',
    trigger_email   varchar(32)  null comment '报警消息接收人邮箱',
    trigger_mobile  varchar(32)  null comment '报警消息接收人电话',
    trigger_wechat  varchar(255) null comment '报警消息接收人微信',
    user_id         varchar(64)  null comment '用户ID',
    create_date     datetime     null comment '创建时间',
    create_by       varchar(64)  null comment '创建者'
)
    comment '触发器报警记录表';

